(778, 1001, 'Ionic sites preparations', '2018-10-28', '2018-W43', 2, 3, 'Work leading to implementation of Ionic sites. \r\n2018 10 28\r\nOpen the linode server intended for Fullstack development (ssh root@139.162.163.199) in Putty.\r\nWant to create a stack specifically for using FULLSTACK. \r\n(1) First create non root Ubuntu user.\r\n    (a) Log into server::::  ssh root@139.162.163.199 \r\n    (b) (add user)::::  adduser leif\r\n    (c) (supply a new password)::::  SinPlex2\r\n    (d) Add the new user to the sudo group::::  $ usermod -aG sudo leif\r\n    (e) Test and switch to new user::::: $ su - leif\r\n    (f) sudo whoami\r\n\r\n(2) Install Apache2\r\n    (a) sudo apt update\r\n    (b) sudo apt install apache2\r\n    (c) adjust firewall:::  sudo ufw app list\r\n    (d) sudo ufw allow \'Apache\'\r\n    (e) sudo ufw status (if inactive run::: sudo ufw enable )\r\n    (f) sudo systemctl status apache2  (check server)\r\n    (g) Go to: http://139.162.163.199/\r\n\r\n(3) Go to Godaddy and update DNS records for Bilkryg, Disagre and Hen.farm. Points to \r\n139.162.163.199 and default Ubuntu page shows. (Need to make virtual paths for domains).\r\n    (a) Bilkryg.com points to 139.162.163.199\r\n    (b) Disagre.com points to 139.162.163.199\r\n    (c) Hen.farm points to 139.162.163.199\r\n', 'http://139.162.163.199', '2018-10-28 13:00:14'),
